// 所有车间显示隐藏  index == 0(筛分间)  1(均化间)  2(立磨间)  3(碎石配料间)  4(破碎间)  5(堆石场)  bool = true(显示) false(隐藏)
export const allRoomToggle = (index, bool) => {
    if (index == 0) {
        allRoomObjs.forEach((item) => {
            if (item.name == "筛分间") {
                item.visible = bool;
            }
        });
    } else if (index == 1) {
        allRoomObjs.forEach((item) => {
            if (item.name == "均化间") {
                item.visible = bool;
            }
        });
    } else if (index == 2) {
        allRoomObjs.forEach((item) => {
            if (item.name == "立磨间") {
                item.visible = bool;
            }
        });
    } else if (index == 3) {
        allRoomObjs.forEach((item) => {
            if (item.name == "碎石配料间") {
                item.visible = bool;
            }
        });
    } else if (index == 4) {
        allRoomObjs.forEach((item) => {
            if (item.name == "破碎间") {
                item.visible = bool;
            }
        });
    } else if (index == 5) {
        allRoomObjs.forEach((item) => {
            if (item.name == "堆石厂") {
                item.visible = bool;
            }
        });
    }
};

// 漫游小车显示隐藏
export const manyouCarToggle = (bool, isPlay) => {
    manyouCar.visible = bool;
    if (bool) {
        manyouCarAnimation.time = 0;
    }
    if (isPlay == null) return false;
    if (isPlay) {
        manyouCarAnimation.loop = THREE.LoopOnce;
        manyouCarAnimation.time = 0;
        manyouCarAnimation.enabled = true;
        manyouCarAnimation.paused = false;
        manyouCarAnimation.clampWhenFinished = true;
    } else {
        manyouCarAnimation.paused = true;
    }
};

// 均化间漫游时单独高亮显示立磨间密相泵物体
export const junhuaRomaingLight = (bool) => {
    let outArr = [];
    junhuaRomaingMesh.traverse((s) => {
        if (s.isMesh) {
            outArr.push(s);
        }
    });
    container.outlineObjects = bool ? outArr : [];
};

// 均化间漫游时单独显示单条输送管道
export const junhuaRomaingLines = (bool, color) => {
    if (bool) {
        GDmodel.traverse((child) => {
            child.visible = false;
        });
        GDmodel.visible = true;
        GDmovingSS.parent.visible = true;
        let arrs = [];
        GDmovingSS.traverse((child) => {
            child.visible = true;
            if (child.isMesh) {
                child.visible = false;
                if (
                    child.name == "输送动画M01" ||
                    child.name == "405仓密相泵AB动画" ||
                    child.name == "A动画" ||
                    child.name == "B动画"
                ) {
                    child.visible = true;
                }
                child.material.color.set(color);
                arrs.push(child);
            }
        });
        // container.outlineObjects_2 = arrs;
        // container.outlinePass_2.hiddenEdgeColor = new THREE.Color(color);
        // container.outlinePass_2.visibleEdgeColor = new THREE.Color(color);
    } else {
        pipeLineFun(0);
    }
};

// 均化间中间楼板设置透明度
export const junhuaLoubanSetOpacity = (i) => {
    junhuaLoubanOpacity.forEach((item) => {
        if (Object.is(item.name, "均化底层楼板带透明通道_1")) {
            item.material.transparent = i == 1 ? false : true;
            item.material.opacity = i;
        }
    });
};

// 粉料动画模型显示隐藏
export const fenliaoMeshHide = (bool) => {
    fenliaoMesh.visible = bool;
};

// 均化间动画外层部分物体透明度设置。
export const fenliaoOpacity = (bool, opacity) => {
	// console.log(junhuaDongHuaMesh)
    junhuaDongHuaMesh.forEach((item) => {
        item.material.transparent = bool;
        item.material.opacity = opacity;
		bool ? container.addBloom(item) : container.removeBloom(item);
    });
	junhuaNoOpacity.forEach(obj => {
		obj.traverse((item) => {
		    if(item.isMesh){
				item.material.transparent = false;
				item.material.opacity = 1;
				container.removeBloom(item);
			}
		});
	})
	junhuaChangeOpacity.forEach(obj => {
		if(obj){
			if(obj.isMesh){
				obj.material.opacity = opacity == 1 ? opacity : 0.2;
			}else{
				obj.traverse((item) => {
				    if(item.isMesh){
						item.material.opacity = opacity == 1 ? opacity : 0.5;
					}
				});
			}
		}
	})
};

// 分料动画1执行
export const fenliaoAnimationOne = () => {
    setTimeout(() => {
    fenliaoFMmove.forEach((item) => {
        item.visible = true;
        if (item.name == "楼上阀门M01-01动") {
            item.rotateOnWorldAxis(new THREE.Vector3(0, 1, 0), Math.PI / 2);
        } else {
            item.rotateOnWorldAxis(new THREE.Vector3(0, 0, 1), Math.PI / 2);
        }
    });
    fenliaoAnimationMesh.forEach((item) => {
        item.visible = false;
    });
    }, 1000);

    setTimeout(() => {
        fenliaoFMmove.forEach((item) => {
            item.visible = true;
            if (item.name == "楼上阀门M01-01动") {
                item.rotateOnWorldAxis(new THREE.Vector3(0, 1, 0), Math.PI / 2);
            } else {
                item.rotateOnWorldAxis(new THREE.Vector3(0, 0, 1), Math.PI / 2);
            }
        });
        fenliaoAnimationMesh.forEach((item) => {
            item.visible = true;
        });
    }, 4000);
};

